select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1574390264,message={id=0,msg=""},news={{title="TradeSkillMaster v4.8.20 Changelog",content="TSM v4.8.20 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed bug with saving of Accounting data.<br />* Fixed bug with AH not properly hiding.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1572221360,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-20-changelog/"},{title="TradeSkillMaster v4.8.19 Changelog",content="TSM v4.8.19 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed bug with professions not loading in previous release.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1572209794,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-19-changelog/"},{title="TradeSkillMaster v4.8.18 Changelog",content="TSM v4.8.18 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed error when running Shopping scan based on required level.<br />* [Retail] Disenchant info fixes.<br />* Fixes issue with Crafting Queue buttons.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1572207273,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-18-changelog/"},{title="TradeSkillMaster v4.8.17 Changelog",content="TSM v4.8.17 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with scan data not saving properly, affecting AuctionDB prices.<br />* [Classic] Sped up manual scans.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1571725001,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-17-changelog/"},{title="TradeSkillMaster v4.8.16 Changelog",content="TSM v4.8.16 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Fixed issue with crafting cost not working in some situations.<br />* [All] Fixed error when renaming custom price source.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1571615855,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-16-changelog/"},{title="TradeSkillMaster v4.8.15 Changelog",content="TSM v4.8.15 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issues with professions on some non-English clients.<br />* [Classic] Fixed issue with region data not loading for some users.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1571604908,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-15-changelog/"},{title="TradeSkillMaster v4.8.14 Changelog",content="TSM v4.8.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with manual scans not recording some items correctly.<br />* [Classic] Removed guild bank sources from Gathering.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569992467,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-14-changelog/"},{title="TradeSkillMaster v4.8.13 Changelog",content="TSM v4.8.13 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with professions on non-English clients.<br />* [Classic] Fixed bug with profession crafts getting duplicated.<br />* [Classic] Added support for loading region data from the app.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569865513,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-13-changelog/"},{title="TradeSkillMaster v4.8.12 Changelog",content="TSM v4.8.12 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixes issues with profession windows that some people were experiencing.<br />* Fixed auction categories for Classic.<br />* Smaller enchanting fix.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569707953,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-12-changelog/"}}}]]) --<APP_INFO,Global,1574390264>
